import React, { useRef, useState, useEffect } from 'react';
import { initializeApp } from 'firebase/app';
import { getDatabase, ref, onValue, set } from 'firebase/database';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

// Firebase configuration
const firebaseConfig = {
  apiKey: "AIzaSyAUjjIy9Sd5r8T5nxIinHbcseCvNHKKag4",
  authDomain: "schoolbus-led.firebaseapp.com",
  databaseURL: "https://schoolbus-led-default-rtdb.firebaseio.com",
  projectId: "schoolbus-led",
  storageBucket: "schoolbus-led.appspot.com",
  messagingSenderId: "1056264797823",
  appId: "YOUR_APP_ID" // Replace with your app ID from Firebase project settings
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);
const database = getDatabase(app);

// User paths for different members
const userPaths = {
  "member1@gmail.com": {
    rfidReaderPath: 'rfid-reader',
    path: 'find-aisle'
  },
  "member2@gmail.com": {
    rfidReaderPath: 'rfid-reader2',
    path: 'find-aisle2'
  }
};

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [username, setUsername] = useState('');
  const [startingAisle, setStartingAisle] = useState('');
  const [selectedItem, setSelectedItem] = useState('');
  const [showDropdown, setShowDropdown] = useState(false);
  const canvasRef = useRef(null);

  // Handle user login
  const handleLogin = (e) => {
    e.preventDefault();
    const formData = new FormData(e.target);
    const username = formData.get('username');
    setIsLoggedIn(true);
    setUsername(username);

    const userPath = userPaths[username];
    if (userPath) {
      const userRef = ref(database, 'current-user');
      set(userRef, username);
    }
  };

  // Handle user logout
  const handleLogout = () => {
    setIsLoggedIn(false);
    setUsername('');
    const userRef = ref(database, 'current-user');
    set(userRef, '');
  };

  // Fetch RFID data on login
  useEffect(() => {
    if (isLoggedIn) {
      const userPath = userPaths[username];
      if (userPath) {
        const rfidRef = ref(database, userPath.rfidReaderPath);

        const rfidUnsubscribe = onValue(rfidRef, (snapshot) => {
          const readerData = snapshot.val();
          if (readerData) {
            setStartingAisle(readerData);
            setShowDropdown(true);
          }
        });

        return () => {
          rfidUnsubscribe();
        };
      }
    }
  }, [isLoggedIn, username]);

  // Draw the L-shaped path on the canvas
  const drawPath = () => {
    const canvas = canvasRef.current;
    if (canvas) {
      const ctx = canvas.getContext('2d');
      ctx.clearRect(0, 0, canvas.width, canvas.height); // Clear previous drawings
      ctx.fillStyle = 'lightgray'; // Set background color
      ctx.fillRect(0, 0, canvas.width, canvas.height); // Draw background

      ctx.strokeStyle = 'blue'; // Set path color
      ctx.lineWidth = 5; // Set path width

      // Draw L-shaped path
      ctx.beginPath();
      ctx.moveTo(50, 50); // Starting point
      ctx.lineTo(50, 150); // Vertical line down
      ctx.lineTo(150, 150); // Horizontal line right
      ctx.lineTo(150, 50); // Vertical line up
      ctx.stroke(); // Render the path
    }
  };

  // Handle aisle and item selection
  useEffect(() => {
    if (startingAisle && selectedItem) {
      drawPath(); // Draw the path based on the selected aisle and item
    } else {
      drawPath(); // Draw default path
    }
  }, [startingAisle, selectedItem]);

  return (
    <div className="App">
      {!isLoggedIn ? (
        <form onSubmit={handleLogin}>
          <input type="text" name="username" placeholder="Enter your email" required />
          <button type="submit">Login</button>
        </form>
      ) : (
        <div>
          <h2>Welcome, {username}!</h2>
          <button onClick={handleLogout}>Logout</button>
          {showDropdown && (
            <div>
              <h3>Select an item:</h3>
              {/* Replace with your item selection logic */}
              <select onChange={(e) => setSelectedItem(e.target.value)}>
                <option value="">Choose an item</option>
                <option value="item1">Item 1</option>
                <option value="item2">Item 2</option>
                {/* Add more items as needed */}
              </select>
            </div>
          )}
          <canvas ref={canvasRef} width={400} height={400} style={{ border: '1px solid black' }} />
        </div>
      )}
    </div>
  );
}

export default App;
